// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;


import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "./IArtist.sol";

contract Artist is IArtist, ERC721, Pausable, AccessControl {
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MANAGE_MINTER_ROLE = keccak256("MINTER_ROLE");
    uint public constant MAX_TOKENS = 8888;

    uint public maxMintPerAddress;
    uint16 public minted;
    uint public mintPrice;

    //for level 'n' this defines the allowed combinations for 'n+1'
    uint8[][9] public allowedCombinations;

    mapping(uint => uint) public existingCombinations;
    mapping(address => bool) public minters;
    mapping(address => uint) public tokensOwned;

    //mapping from tokenId to struct containing traits
    mapping (uint256 => Person) public tokenTraits;

    constructor() ERC721("Artist", "CBA") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MANAGE_MINTER_ROLE, msg.sender);

        mintPrice = 0.3 ether;
        maxMintPerAddress = 2;

        //background
        allowedCombinations[0] = [0];

        //body
        allowedCombinations[1] = [0];

        //eyes
        allowedCombinations[2] = [0];

        //teeth
        allowedCombinations[3] = [0];

        //garment
        allowedCombinations[4] = [0];

        //chain
        allowedCombinations[5] = [0];

        //face
        allowedCombinations[6] = [0];

        //ear
        allowedCombinations[7] = [0];

        //head
        allowedCombinations[8] = [0];
    }

    function addMinter(address[] memory _minters) external onlyRole(MANAGE_MINTER_ROLE) {
        for (uint x = 0; x < _minters.length; x++) {
            minters[_minters[x]] = true;
        }
    }

    function generate(uint256 tokenId, uint256 seed) internal returns (Person memory t) {
        t = selectTraits(seed);
        if (existingCombinations[structToHash(t)] == 0) {
            tokenTraits[tokenId] = t;
            existingCombinations[structToHash(t)] = tokenId;
            return t;
        }
        return generate(tokenId, random(seed));
    }

    function mint(uint8 amount) public payable {
        require(msg.value >= mintPrice, "The amount specified does not match the minimum mint price");
        require(minters[msg.sender], "You are not a member of the minting whitelist");
        require(tokensOwned[msg.sender] < maxMintPerAddress, "You may not mint any more tokens with this address");
        require(minted + amount <= MAX_TOKENS, "All tokens have been minted");

        minted++;
        uint seed = random(minted);
        generate(minted, seed);

        tokensOwned[msg.sender]++;
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function removeMinter(address[] memory _minters) external onlyRole(MANAGE_MINTER_ROLE) {
        for (uint x = 0; x < _minters.length; x++) {
            minters[_minters[x]] = false;
        }
    }

    function setMaxMintPerAddress(uint max) external onlyRole(DEFAULT_ADMIN_ROLE) {
        maxMintPerAddress = max;
    }

    function setMintPrice(uint _mintPrice) external onlyRole(DEFAULT_ADMIN_ROLE) {
        mintPrice = _mintPrice;
    }

    function structToHash(Person memory s) internal pure returns (uint256) {
        return uint256(bytes32(
        abi.encodePacked(
            s.background,
            s.body,
            s.eyes,
            s.teeth,
            s.garment,
            s.chain,
            s.face,
            s.ear,
            s.head
        )));
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function random(uint256 seed) internal view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(
        tx.origin,
        blockhash(block.number - 1),
        block.timestamp,
        seed
        )));
    }

    function safeMint(address to, uint256 tokenId) public onlyRole(MANAGE_MINTER_ROLE) {
        _safeMint(to, tokenId);
    }

    function selectTrait(uint16 seed, uint8 traitType) internal view returns (uint8) {
        uint8 trait = uint8(seed) % uint8(allowedCombinations[traitType].length);
        if (seed >> 9 < allowedCombinations[traitType][trait]) return trait;
        return allowedCombinations[traitType][trait];
    }

    function selectTraits(uint256 seed) internal view returns (Person memory t) {    
        seed >>= 9;
        t.background = selectTrait(uint16(seed & 0xFFFF), 0);
        seed >>= 9;
        t.body = selectTrait(uint16(seed & 0xFFFF), 1);
        seed >>= 9;
        t.eyes = selectTrait(uint16(seed & 0xFFFF), 2);
        seed >>= 9;
        t.teeth = selectTrait(uint16(seed & 0xFFFF), 3);
        seed >>= 9;
        t.garment = selectTrait(uint16(seed & 0xFFFF), 4);
        seed >>= 9;
        t.chain = selectTrait(uint16(seed & 0xFFFF), 5);
        seed >>= 9;
        t.face = selectTrait(uint16(seed & 0xFFFF), 6);
        seed >>= 9;
        t.ear = selectTrait(uint16(seed & 0xFFFF), 7);
        seed >>= 9;
        t.head = selectTrait(uint16(seed & 0xFFFF), 8);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function getTokenTraits(uint256 tokenId) external view override returns (Person memory) {
        return tokenTraits[tokenId];
    }

    // The following functions are overrides required by Solidity.

